import React from 'react';

const Button = (props) => {
    let className = 'btn';
    if (props.classTypes) className += ' btn--' + props.types.join(' btn--');
    if (props.type)
        return (
            <button className={className} onClick={props.onClick}>
                {props.children}
            </button>
        );
};

export default Button;
